import React, { Component } from "react";
import Speech from 'react-speech';

var GameOver = (props) => {
    // console.log(props.activeCategor
    // let categories =props.categories 
    return (
        <div className = "game-over">
            <div className = "contestants-table">
            {props.contestants.map((player, index) => (


            <div className = "contestant" key = {index}>
                <div className = "readout">
                   <span className = "player-name"> {player.name}</span> guessed {props.finalGuesses[player.name]} and wagered
                    {abs(props.scores[player._id] - player.finalScores[player._id])}. For a final score of {props.finalScores[player._id]}
                   </div>
            </div>
            ))}
        </div>
        </div>

    )
}

export default GameOver;
